import React from 'react';

import logo from '../assets/img/logo.png'

const mainNav = [
  {
    display: "Trang chủ",
    path: "/"
},
{
    display: "Sản phẩm",
    path: "/catalog"
},
{
    display: "Phụ kiện",
    path: "/accessories"
},
{
    display: "Liên hệ",
    path: "/contact"
}
]

const Header = () => {
  return (
    <div className="header">
      <div className="container">
        .header
      </div>
    </div>
  )
};

export default Header;
